# function to make the reverse complement of the string inside text
def RevComplement(text):
    res = ''
    for i in text:
        if i=='A':
            res+='T'
        elif i=='T':
            res+='A'
        elif i=='G':
            res+='C'
        else:
            res+='G'
    #Reverse the string
    return res[::-1]

Text = ''
RevCom = RevComplement(Text)
print(RevCom)
